import React from 'react';
import './Dm.css';

const Aside = ({ buttonContent }: { buttonContent: string }) => {
	return (
		<div className="dm-aside">
			<button className="new-input">{buttonContent}</button>
		</div>
	);
};

export const Dm = () => {
	return (
		<div className="dm">
			<Aside buttonContent="New DM" />
			<div className="dm-chat"></div>
		</div>
	);
};
